function startTurn(hypeDocument, element) {

	clearTimeout(hypeDocument.timer);

	if (hypeDocument.players < hypeDocument.PlayerTurns)
	{
		var d=new Date();
		var timeLeft = d.getTime() - hypeDocument.TaskStartTime;
		hypeDocument.timetogo = hypeDocument.timetogo - timeLeft;
	}

	hypeDocument.GetNextPlayer();
	hypeDocument.PlayerTurns++;
}

