function startRound(hypeDocument, element) {

	if(hypeDocument.playerList.length <= 1)
		hypeDocument.showSceneNamed("Winner");

	else
	{

	hypeDocument.Round++;
	var reductionRatio = 1 - ( (hypeDocument.Round - 1) * (hypeDocument.TimeReductionPercent / 100) );
	var originalTime = Math.floor(Math.random()*hypeDocument.TimerRange) + hypeDocument.TimerMin;
	hypeDocument.timetogo = originalTime * reductionRatio;

	//alert(originalTime + " was reduced by " + hypeDocument.TimeReductionPercent + "% to " + hypeDocument.timetogo);

	hypeDocument.showSceneNamed("Right");
	//Custom.startTurn(hypeDocument, element);
	}
}

function startGameTwo(hypeDocument, element) {
	hypeDocument.players = 2;
	Custom.startGame(hypeDocument, element);
}

function startGameFour(hypeDocument, element) {
	hypeDocument.players = 4;
	Custom.startGame(hypeDocument, element);
}

function endRound(hypeDocument, element) {

	hypeDocument.RemoveCurrentPlayer();

	if (navigator != undefined)
	{
		if (navigator.notification != undefined)
		{
			navigator.notification.beep();
			navigator.notification.vibrate();
		}
	}
		Custom.startRound(hypeDocument, element);
}

function startGame(hypeDocument, element) {

	hypeDocument.playerList = hypeDocument.GetPlayers();
	hypeDocument.players = hypeDocument.playerList.length;

	hypeDocument.TimerMin = 10000;
	hypeDocument.TimerRange = 5000;
	hypeDocument.TaskTotal = 32;
	hypeDocument.Round = 0;	
	hypeDocument.TimeReductionPercent = 15;

	hypeDocument.CurrentTask = Math.floor(Math.random() * hypeDocument.TaskTotal) + 1;
	hypeDocument.PlayerTurns = 0;

	var primeNumList = [ 37, 41, 43, 47, 53, 59, 61, 67 ];
	hypeDocument.RandomPrime = primeNumList[hypeDocument.nextRandomItemNum(primeNumList)];

	Custom.startRound(hypeDocument, element);

	if(typeof ping == 'function')
	{
		ping();
	}
}

function startApp(hypeDocument, element) {

	hypeDocument.nextRandomItemNum = function(itemList, optionalCurrentItemNum, optionalPrimeNumber)
	{
		if (optionalCurrentItemNum == undefined || optionalPrimeNumber == undefined)
		{
			return Math.floor(Math.random() * itemList.length); 
		}

		else
		{
			optionalCurrentItemNum = optionalCurrentItemNum + optionalPrimeNumber;

			while (optionalCurrentItemNum >= itemList.length)
			{
				optionalCurrentItemNum -= itemList.length;
			}
		}

		if (optionalCurrentItemNum >= itemList.length || optionalCurrentItemNum < 0)
		{
			optionalCurrentItemNum = 0;
		}

		return optionalCurrentItemNum;
	}


	hypeDocument.GetPlayers = function()
	{
		var players = new Array();
		players[0]={name:"Buck-o",score:0,image:"http://cdn1.iconfinder.com/data/icons/walle/128/my_documents.png"}
		players[1]={name:"Ernie",score:0,image:"http://cdn1.iconfinder.com/data/icons/Dunking/128/Donut_2.png"}
		players[2]={name:"Burt",score:0,image:"http://cdn1.iconfinder.com/data/icons/gamble_icons/128/Cap.png"}

		return players;
	}

	hypeDocument.CurrentPlayerNum = -1;

	hypeDocument.GetNextPlayer = function()
	{
		hypeDocument.CurrentPlayerNum++;

		if (hypeDocument.CurrentPlayerNum >= hypeDocument.playerList.length)
		{
			hypeDocument.CurrentPlayerNum = 0;
		}


		hypeDocument.CurrentPlayer = hypeDocument.playerList[hypeDocument.CurrentPlayerNum];	
		var image = document.getElementById("35EB9E2F-28CF-4353-A22D-11377C1EC172-4527-00002DF1D3EF089F");
		image.style.backgroundImage = "url(" + hypeDocument.CurrentPlayer.image + ")";

		var textBox = document.getElementById("720F7004-79EF-4792-85AE-E64452267946-4527-00002DB6ECA0F932");
		textBox.innerHTML = hypeDocument.CurrentPlayer.name;

		return hypeDocument.CurrentPlayer;
	}

	hypeDocument.RemoveCurrentPlayer = function()
	{		
		var playerIndex = 0;

		for (i = 0; i < hypeDocument.playerList.length; i++)
		{
			if (hypeDocument.playerList[i].name == hypeDocument.CurrentPlayer.name)
				playerIndex = i;
		}

		hypeDocument.playerList.splice(i, 1);

		hypeDocument.players = hypeDocument.playerList.length;
	}

	Custom.startGame(hypeDocument, element);
}

function toggleQRCode(hypeDocument, element) {
	/*	
		hypeDocument - access to the hype document API:
						METHODS:
						hypeDocument.documentName()
						hypeDocument.sceneNames()
						hypeDocument.currentSceneName()
						hypeDocument.showSceneNamed(sceneName, optionalTransition)
						hypeDocument.showNextScene(optionalTransition)
						hypeDocument.showPreviousScene(optionalTransition)
						hypeDocument.playTimelineNamed(timelineName)

						MORE INFO:
						http://tumultco.com/hype/documentation/javascript/

		element - DOMHTMLElement that triggered this function being called
	*/

	if (hypeDocument.QRCodeBig == 0 || hypeDocument.QRCodeBig == undefined)
	{
		hypeDocument.playTimelineNamed("Code Timeline");
		hypeDocument.QRCodeBig = 1;
	}
	else
	{
		hypeDocument.playTimelineNamed("CodeBack Timeline");
		hypeDocument.QRCodeBig = 0;
	}

}

