	];


	if (hypeDocument.players < hypeDocument.PlayerTurns || hypeDocument.Round == 1)
	{
		hypeDocument.TaskStartTime = new Date();

		if (hypeDocument.timetogo < 1000)
		{
			hypeDocument.timetogo = 1000;
		}

		hypeDocument.timer = setTimeout(function() {hypeDocument.showSceneNamed('Boom')},hypeDocument.timetogo); 
	}	

	hypeDocument.CurrentTask = hypeDocument.nextRandomItemNum( taskList, hypeDocument.CurrentTask, hypeDocument.RandomPrime );
	hypeDocument.showSceneNamed( taskList[ hypeDocument.CurrentTask ] );
}
